import React from 'react';

const DetailDogs = ({match}) => {
    const {id,name,description,age,published_at,breed} = match.params;
    return(
        <div>
            
            
           Dog ID: {id} <br/>
           Dog Name: {name}<br/>
           Dog Age: {age}<br/>
           Dog Breed: {breed}<br/>
           Description {description}<br/>
           Published: {published_at}<br/>
                
           
            
        </div>
    )
}





export default DetailDogs;
